(43, '¡Loteria ha terminado!', 'Gracias a todas las personas que participaron en la lotería semanal de BoomBang.\r\rDesgraciadamente esta semana no hubo un ganador de la lotería :(\r\rHa empezado nueva ronda de lotería que acaba en 7 días - 25/08/2019 10:06:37\r\rSi deseas participar en la lotería semanal, compra el ticket de lotería en nuestro catálogo. El ticket se localiza en el Set News y su valor es de 2.000 créditos.', 3, '', '', '', '', '2019-8-18'),
